import React from "react";
import styled from "styled-components";
import { PagesWrap } from "../styles/Template";
import { StartBtn, AccountBtn } from "../styles/buttons/MainBtn";
import img1 from "../images/main/main_img1.jpg";

const MainPage = () => {
  return (
    <PagesWrap>
      <Title>Sanlio’s keyring gamble</Title>
      <img src={img1} />
      <StartBtn />
      <AccountBtn />
    </PagesWrap>
  );
};

const Title = styled.h1`
  font-size: 6rem;
  color: #f277ab;
  /* text-shadow: 2px 2px 4px #f01d76; */
  -webkit-text-stroke-width: 2px;
  -webkit-text-stroke-color: #f01d76;
`;

export default MainPage;
